def solve_dragonduck_dna(input_text):
    """
    Solves the dragonduck DNA inheritance problem.

    Args:
        input_text: String containing lines in format "ID:DNA_SEQUENCE"

    Returns:
        Total sum of all similarity degrees
    """
    # Parse input
    scales = {}
    lines = input_text.strip().split('\n')

    for line in lines:
        line = line.strip()
        if ':' in line:
            id_str, dna = line.split(':', 1)
            scales[id_str.strip()] = dna.strip()

    ids = list(scales.keys())
    relationships = []
    total_sum = 0

    # Check all possible parent-child combinations
    for i in range(len(ids)):
        for j in range(i + 1, len(ids)):
            for k in range(len(ids)):
                if k == i or k == j:
                    continue

                parent1 = scales[ids[i]]
                parent2 = scales[ids[j]]
                child = scales[ids[k]]

                # Check if lengths match
                if len(parent1) != len(child) or len(parent2) != len(child):
                    continue

                matches_p1 = 0
                matches_p2 = 0
                is_valid = True

                # Check if child can be formed from these parents
                for pos in range(len(child)):
                    child_nuc = child[pos]
                    p1_nuc = parent1[pos]
                    p2_nuc = parent2[pos]

                    matches_parent1 = (child_nuc == p1_nuc)
                    matches_parent2 = (child_nuc == p2_nuc)

                    # Child must match at least one parent at each position
                    if not matches_parent1 and not matches_parent2:
                        is_valid = False
                        break

                    if matches_parent1:
                        matches_p1 += 1
                    if matches_parent2:
                        matches_p2 += 1

                if is_valid:
                    similarity = matches_p1 * matches_p2
                    relationships.append({
                        'child': ids[k],
                        'parent1': ids[i],
                        'parent2': ids[j],
                        'matches_p1': matches_p1,
                        'matches_p2': matches_p2,
                        'similarity': similarity
                    })
                    total_sum += similarity

    # Print results
    print(f"Scales analyzed: {len(ids)}")
    print(f"Relationships found: {len(relationships)}")
    print("\nFamily Relationships:")
    print("-" * 60)

    for rel in relationships:
        print(f"Child {rel['child']} ← Parent {rel['parent1']} + Parent {rel['parent2']}")
        print(f"  Similarity: {rel['matches_p1']} × {rel['matches_p2']} = {rel['similarity']}")

    print("-" * 60)
    print(f"\nTOTAL SUM OF SIMILARITY DEGREES: {total_sum}")

    return total_sum


